import React from 'react';
import "../../scss/header/header.scss"
function Header(props) {
    return (
      <div className='header'>
        <div className='header_container'>
          <ul className='navigation'>
            <li className='unde_navigation'></li>
          </ul>
        </div>
      </div>
    )
}

export default Header;
